import React from 'react';
import {CgProfile} from "react-icons/cg";

const _styleProfile = {
    iconProfile:{
        width: '25px',
        height: '35px',
        borderRadius: '33px',
        color: '#767676',
        cursor: 'pointer',
    },
};

function PinProfileUser() {
    return (
        <CgProfile style={_styleProfile.iconProfile} />
        )
}

export default PinProfileUser
